package javaprogram;

public class Number {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n1=Integer.parseInt(args[0]);
		int n2=Integer.parseInt(args[1]);
       if(n1>n2)	
    
    	System.out.println("Greater Number="+n1);
    
    else
    
    	System.out.println("Greater Number="+n2);
    
	}
   }
    	




